package WrittenBasic;

public class OddNumber521TO229 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 521;
		int b = 229;
		System.out.println("odd number 521 to 229");
		while (a >= b) {
			if (a % 2 == 1) {
				System.out.println(a);
			}
			a--;
		}
	}

}
